<div class="acf-field acf-field-textarea acf-field-639ce61e39841 is-required" data-name="summary" data-type="textarea" data-key="field_639ce61e39841" data-required="1">
<div class="acf-label">
<label for="acf-field_639ce5c93983f-row-1-field_639ce61e39841">Summary <span class="acf-required">*</span></label></div>
<div class="acf-input">
<textarea id="acf-field_639ce5c93983f-row-1-field_639ce61e39841" name="acf[field_639ce5c93983f][row-1][field_639ce61e39841]" rows="8" required="required">In cooperation with OVW, the National Council of Juvenile and Family Court Judges (NCJFCJ) will serve as OVW&#039;s comprehensive judicial techncial assistance provider, supporting training and technical assistance for state, local, tribal, and territorial judges. A major component of NCJFCJ&#039;s work will be its continued partnership with Futures Without Violence (formerly known as the Family Violence Prevention Fund) and OVW in the operation of the National Judicial Institute on Domestic Violence (NJIDV), which delivers a continuum of judicial education on domestic violence and elder abuse. Since NJIDVâ€™s inception in 1998, NCJFCJ and Futures Without Violence have structured a highlyâ€“respected, successful model for developing and delivering highâ€“quality, interactive judicial education. Additionally, as the comprehensive judicial technical assistance provider, NCJFCJ will continue its efforts to provide technical assistance to judges and other court staff across OVW&#039;s grant programs. Technical assistance offerings may include, but are not limited to: peerâ€“toâ€“peer exchange opportunities for judges and nonâ€“judge court staff, onâ€“site policy and process review, oneâ€“onâ€“one judicial mentoring, and regional, state, or community specific training curricula development and delivery.</textarea></div>
